<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Distritos Electorales Locales ‚Äî Coahuila</title>
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/leaflet.min.css"/>
<script src="https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/leaflet.min.js"></script>
<link href="https://fonts.googleapis.com/css2?family=Syne:wght@700;800&family=Inter:wght@300;400;500&display=swap" rel="stylesheet">
<style>
  :root {
    --bg: #0b0d14;
    --panel: #10121c;
    --panel2: #161927;
    --border: rgba(255,255,255,0.06);
    --accent: #f0c040;
    --text: #e8e2d4;
    --muted: rgba(232,226,212,0.4);
  }
  * { margin:0; padding:0; box-sizing:border-box; }
  body { font-family:'Inter',sans-serif; background:var(--bg); color:var(--text); height:100vh; display:flex; flex-direction:column; overflow:hidden; }

  header {
    padding: 12px 24px;
    background: var(--panel);
    border-bottom: 1px solid var(--border);
    display: flex; align-items:center; justify-content:space-between;
    z-index: 1000;
  }
  .ht { font-family:'Syne',sans-serif; font-size:1.2rem; font-weight:800; color:var(--accent); letter-spacing:-0.02em; }
  .hs { font-size:0.68rem; color:var(--muted); letter-spacing:0.1em; text-transform:uppercase; margin-top:1px; }
  .badge { background:rgba(240,192,64,0.1); border:1px solid rgba(240,192,64,0.25); color:var(--accent); padding:3px 10px; border-radius:20px; font-size:0.68rem; font-weight:500; letter-spacing:0.06em; }

  .main { display:flex; flex:1; overflow:hidden; }
  #map { flex:1; }

  .sidebar {
    width:270px;
    background:var(--panel);
    border-left:1px solid var(--border);
    display:flex; flex-direction:column;
    overflow:hidden;
  }
  .sb-head { padding:14px 18px 10px; border-bottom:1px solid var(--border); }
  .sb-head h2 { font-family:'Syne',sans-serif; font-size:0.85rem; font-weight:700; }
  .sb-head p { font-size:0.65rem; color:var(--muted); margin-top:2px; }

  .dlist { overflow-y:auto; flex:1; }
  .dlist::-webkit-scrollbar { width:3px; }
  .dlist::-webkit-scrollbar-thumb { background:var(--border); border-radius:2px; }

  .ditem {
    display:flex; align-items:center; gap:10px;
    padding:8px 18px; cursor:pointer;
    border-left:3px solid transparent;
    transition:background 0.12s;
  }
  .ditem:hover { background:rgba(255,255,255,0.03); }
  .ditem.active { background:rgba(240,192,64,0.07); border-left-color:var(--accent); }
  .dot { width:10px; height:10px; border-radius:50%; flex-shrink:0; }
  .ditem-info h3 { font-size:0.75rem; font-weight:500; line-height:1.2; }
  .ditem-info p { font-size:0.62rem; color:var(--muted); margin-top:1px; }

  .detail {
    border-top:1px solid var(--border);
    padding:14px 18px;
    background:var(--panel2);
    min-height:140px;
  }
  .detail h3 { font-family:'Syne',sans-serif; font-size:1rem; font-weight:800; color:var(--accent); margin-bottom:6px; }
  .detail .dl { font-size:0.7rem; color:var(--muted); line-height:1.9; }
  .detail .dl strong { color:var(--text); font-weight:500; }
  .placeholder { font-size:0.72rem; color:var(--muted); font-style:italic; line-height:1.7; }

  /* Leaflet */
  .leaflet-container { background:#080a12 !important; }
  .leaflet-control-zoom { border:1px solid var(--border) !important; }
  .leaflet-control-zoom a { background:var(--panel) !important; color:var(--text) !important; border-color:var(--border) !important; }
  .leaflet-control-zoom a:hover { background:rgba(255,255,255,0.08) !important; }
  .leaflet-popup-content-wrapper { background:var(--panel); color:var(--text); border:1px solid var(--border); border-radius:8px; box-shadow:0 8px 30px rgba(0,0,0,0.6); }
  .leaflet-popup-tip { background:var(--panel); }
  .leaflet-popup-content { font-family:'Inter',sans-serif; margin:12px 16px; }
  .pop-title { font-family:'Syne',sans-serif; font-size:0.95rem; font-weight:800; color:var(--accent); margin-bottom:6px; }
  .pop-row { font-size:0.72rem; color:var(--muted); line-height:1.8; }
  .pop-row strong { color:var(--text); }
</style>
</head>
<body>

<header>
  <div>
    <div class="ht">Distritos Electorales ¬∑ Coahuila</div>
    <div class="hs">Distritaci√≥n Local COAHUILA 2026</div>
  </div>
  <div class="badge">Datos Oficiales INE</div>
</header>

<div class="main">
  <div id="map"></div>
  <div class="sidebar">
    <div class="sb-head">
      <h2>Distritos</h2>
      <p>Selecciona para ver detalle</p>
    </div>
    <div class="dlist" id="dlist"></div>
    <div class="detail" id="detail">
      <p class="placeholder">‚Üê Haz clic en un distrito del mapa o en la lista para ver su informaci√≥n.</p>
    </div>
  </div>
</div>

<script>
const distritoInfo = {
  1:  { nombre:"Distrito I",   cabecera:"Acu√±a",         municipios:"Acu√±a, Jim√©nez, Zaragoza" },
  2:  { nombre:"Distrito II",  cabecera:"Piedras Negras", municipios:"Piedras Negras" },
  3:  { nombre:"Distrito III", cabecera:"Sabinas",        municipios:"Allende, Escobedo, Guerrero, Hidalgo, Ju√°rez, Morelos, Nava, Progreso, Sabinas, San Juan de Sabinas, Villa Uni√≥n" },
  4:  { nombre:"Distrito IV",  cabecera:"San Pedro",      municipios:"Abasolo, Candela, Casta√±os, Cuatro Ci√©negas, Lamadrid, Monclova, Sacramento, San Pedro" },
  5:  { nombre:"Distrito V",   cabecera:"Monclova",       municipios:"Monclova" },
  6:  { nombre:"Distrito VI",  cabecera:"Frontera",       municipios:"Frontera, M√∫zquiz, Nadadores, Ocampo, San Buenaventura, Sierra Mojada" },
  7:  { nombre:"Distrito VII", cabecera:"Matamoros",      municipios:"Francisco I. Madero, Matamoros, Torre√≥n, Viesca" },
  8:  { nombre:"Distrito VIII",cabecera:"Torre√≥n I",        municipios:"Torre√≥n" },
  9:  { nombre:"Distrito IX",  cabecera:"Torre√≥n II",        municipios:"Torre√≥n" },
  10: { nombre:"Distrito X",   cabecera:"Torre√≥n III",        municipios:"Torre√≥n" },
  11: { nombre:"Distrito XI",  cabecera:"Torre√≥n IV",        municipios:"Torre√≥n" },
  12: { nombre:"Distrito XII", cabecera:"Ramos Arizpe",   municipios:"Arteaga, General Cepeda, Parras, Ramos Arizpe" },
  13: { nombre:"Distrito XIII",cabecera:"Saltillo I",       municipios:"Saltillo" },
  14: { nombre:"Distrito XIV", cabecera:"Saltillo II",       municipios:"Saltillo" },
  15: { nombre:"Distrito XV",  cabecera:"Saltillo III",       municipios:"Saltillo" },
  16: { nombre:"Distrito XVI", cabecera:"Saltillo IV",       municipios:"Saltillo" },
};

const colores = [
  "#e85a4a","#e8944a","#e8c84a","#9ee84a","#4ae875",
  "#4abde8","#4a72e8","#874ae8","#c84ae8","#e84ab3",
  "#e84a72","#ff6b6b","#ffa040","#40d4a0","#a0e840","#40a0e8"
];

// L√≠mites de Coahuila
const coahuilaBounds = L.latLngBounds(
  L.latLng(24.5, -105.2),  // suroeste
  L.latLng(30.2, -99.0)    // noreste
);

const map = L.map('map', {
  center: [27.2, -102.0],
  zoom: 7,
  minZoom: 6,
  maxZoom: 13,
  maxBounds: coahuilaBounds,
  maxBoundsViscosity: 1.0  // no deja salir del estado
});
L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
  attribution:'¬© OpenStreetMap ¬© CARTO', maxZoom:14
}).addTo(map);

let activeLayer = null, activeItem = null;

function showDetail(d) {
  const info = distritoInfo[d];
  document.getElementById('detail').innerHTML = `
    <h3>${info.nombre}</h3>
    <div class="dl">
      <strong>üìç Distrito:</strong> ${info.cabecera}<br>
      <strong>üèò Municipios:</strong> ${info.municipios}
    </div>
  `;
}

const layers = {};

function buildMap(geojsonData) {
  L.geoJSON(geojsonData, {
    style: feat => {
      const d = feat.properties.distrito_l;
      return {
        color: colores[d-1], weight:1.5, opacity:0.9,
        fillColor:colores[d-1], fillOpacity:0.2
      };
    },
    onEachFeature: (feat, layer) => {
      const d = feat.properties.distrito_l;
      const info = distritoInfo[d];
      layers[d] = layer;

      layer.on('mouseover', function() {
        if (activeLayer !== this) this.setStyle({ fillOpacity:0.45, weight:2.5 });
      });
      layer.on('mouseout', function() {
        if (activeLayer !== this) this.setStyle({ fillOpacity:0.2, weight:1.5 });
      });
      layer.on('click', function() {
        selectDistrict(d, this);
      });

      layer.bindPopup(`
        <div class="pop-title">${info.nombre}</div>
        <div class="pop-row"><strong>Cabecera:</strong> ${info.cabecera}</div>
        <div class="pop-row"><strong>Municipios:</strong> ${info.municipios}</div>
      `);
    }
  }).addTo(map);

  buildSidebar();
}

function selectDistrict(d, layer) {
  if (activeLayer) activeLayer.setStyle({ fillOpacity:0.2, weight:1.5 });
  if (activeItem) activeItem.classList.remove('active');
  activeLayer = layer;
  layer.setStyle({ fillOpacity:0.55, weight:3 });
  map.fitBounds(layer.getBounds(), { padding:[30,30] });
  showDetail(d);
  const item = document.getElementById(`item-${d}`);
  if (item) { item.classList.add('active'); item.scrollIntoView({behavior:'smooth',block:'nearest'}); activeItem = item; }
}

function buildSidebar() {
  const list = document.getElementById('dlist');
  for (let d = 1; d <= 16; d++) {
    const info = distritoInfo[d];
    const item = document.createElement('div');
    item.className = 'ditem'; item.id = `item-${d}`;
    item.innerHTML = `
      <div class="dot" style="background:${colores[d-1]}"></div>
      <div class="ditem-info">
        <h3>${info.nombre}</h3>
        <p>${info.cabecera}</p>
      </div>
    `;
    item.addEventListener('click', () => selectDistrict(d, layers[d]));
    list.appendChild(item);
  }
}
